import React, { Component } from 'react'
import './Headline.css'
class Headline extends Component {
  render() {
    return (
      <div className="haed-container">
        <div className="start"></div>
        <div className="middle"></div>
        <div className="end"></div>
      </div>
    )
  }
}

export default Headline
